int color[320][240];//colour marteix of whole display

//function to draw tree in background
void tree(int x , int y){
	for(int i = -10 ; i<10 ; i++){
		for(int j = -10 ; j<10 ; j++){
			write_pixel(x+i , y+j , GREEN);
			color[x+i][y+j] = GREEN;
		}
	}
	for(int i = -2 ; i<=2 ; i++){
		for(int j = 0 ; j<=18 ; j++){
			write_pixel(x+i , y+j  , 0);
			color[x+i][y+j] = 0;
		}
	}
}

