short co;
void backgr(int x){
	clear_screen();
	if(x==1){
		co = 0xA500;
		for(int i = 0 ; i<60 ; i++){
			for(int j = 0 ; j<320 ; j++){
				write_pixel(j , i , 0xA500);
				color[j][i] = 0xA500 ;
			}
		}
		for(int i = 180 ; i<240 ; i++){
			for(int j = 0 ; j<320 ; j++){
				write_pixel(j , i , 0xA500);
				color[j][i] = 0xA500;
			}
		}
		for(int i = 20 ; i<300 ; i+=60){
			tree(i , 32);
		}
		for(int i = 20 ; i<300 ; i+=60){
			tree(i , 212);
		}
	}
	
	if(x==2){
		co = 0xefd5;
		for(int i = 0 ; i<60 ; i++){
			for(int j = 0 ; j<320 ; j++){
				write_pixel(j , i , NAVY);
			}
		}
		for(int i = 180 ; i<240 ; i++){
			for(int j = 0 ; j<320 ; j++){
				write_pixel(j , i , NAVY);
			}
		}

		for(int i = 10 ; i<300 ; i+=60){
			saq(i , 40);
		}
		for(int i = 30 ; i<300 ; i+=60){
			saq(i , 20);
		}
		for(int i = 30 ; i<300 ; i+=60){
			saq(i , 200);
		}
		for(int i = 10 ; i<300 ; i+=60){
			saq(i , 220);
		}
	}
	
	if(x==3){
		co = 0xefd5;
		for(int i = 0 ; i<60 ; i++){
			for(int j = 0 ; j<320 ; j++){
				write_pixel(j , i , 0xefd5);
			}
		}
		for(int i = 180 ; i<240 ; i++){
			for(int j = 0 ; j<320 ; j++){
				write_pixel(j , i , 0xefd5);
			}
		}

		for(int i = 10 ; i<300 ; i+=60){
			saq1(i , 40);
		}
		for(int i = 30 ; i<300 ; i+=60){
			saq1(i , 20);
		}
		for(int i = 10 ; i<300 ; i+=60){
			saq1(i , 200);
		}
		for(int i = 30 ; i<300 ; i+=60){
			saq1(i , 220);
		}
	}

	for(int i = 0 ; i+5<320 ; i+= 10){
		for(int j = 0 ; j<5 ; j++){
			write_pixel(i+j , 60 , 0xffff);
			color[i+j][60] = 0xffff;
		}
	}
	for(int i = 0 ; i+5<320 ; i+= 10){
		for(int j = 0 ; j<5 ; j++){
			write_pixel(i+j , 100 , 0xffff);
			color[i+j][100] = WHITE;
		}
	}
	for(int i = 0 ; i+5<320 ; i+= 10){
		for(int j = 0 ; j<5 ; j++){
			write_pixel(i+j , 140 , 0xffff);
			color[i+j][140] = WHITE;
		}
	}
	for(int i = 0 ; i+5<320 ; i+= 10){
		for(int j = 0 ; j<5 ; j++){
			write_pixel(i+j , 180 , 0xffff);
			color[i+j][180] = WHITE;
		}
	}
	
}
int playerx[400];
int playery[400];
void player_design(int x , int y){
	for(int i = 0 ; i<400 ; i++){
		playerx[i] = 0;
		playery[i] = 0;
	}
	int cnt = 0;
	//body
	for(int i = -4 ; i<5 ; i++){
		for(int j = -7 ; j<4 ; j++){
			write_pixel(x+i , y+j , NAVY);
			playerx[cnt] = x+i;
			playery[cnt] = y+j;
			cnt++;
		}
	}
	//face
	for(int i = 0 ; i<4 ; i++){
		for(int j = -11 ; j<=-8 ; j++){
			write_pixel(x+i , y+j , 0xefd5);
			playerx[cnt] = x+i;
			playery[cnt] = y+j;
			cnt++;
		}
	}
	//eye
	write_pixel(x+3 , y-10 , 0);
	playerx[cnt] = x+3;
	playery[cnt] = y-10;
	cnt++;
	//hair
	for(int i = -2 ; i<4 ;i++){
		for(int j = -13 ; j<=-11 ; j++){
			write_pixel(x+i , y+j , LGRAY);
			playerx[cnt] = x+i;
			playery[cnt] = y+j;
			cnt++;
		}
	}

	//legs
	for(int i = -4 ; i<=-1 ; i++){
		for(int j = 4 ; j<=11 ; j++){
			write_pixel(x+i , y+j , RED);
			write_pixel(x+i+5 , y+j , RED);
			playerx[cnt] = x+i;
			playery[cnt] = y+j;
			cnt++;
			playerx[cnt] = x+i+5;
			playery[cnt] = y+j;
			cnt++;
		}
	}
	// shoes
	for(int i = -4 ; i<=-1 ; i++){
		for(int j = 12 ; j<=13 ; j++){
			write_pixel(x+i , y+j , 0xefd5);
			write_pixel(x+i+5 , y+j ,0xefd5);
			playerx[cnt] = x+i;
			playery[cnt] = y+j;
			cnt++;
			playerx[cnt] = x+i+5;
			playery[cnt] = y+j;
			cnt++;
		}
	}
	//hand
	for(int i = 1 ; i<=2 ; i++){
		for(int j = -5 ; j<= 0 ; j++){
			write_pixel(x+i , y+j , 0xefd5);
			playerx[cnt] = x+i;
			playery[cnt] = y+j;
			cnt++;
		}
	}
	for(int i = 3 ; i<=5 ; i++){
		for(int j = -1 ; j<= 0 ; j++){
			write_pixel(x+i , y+j , 0xefd5);
			playerx[cnt] = x+i;
			playery[cnt] = y+j;
			cnt++;
		}
	}
	//gloves
	write_pixel(x+6 , y-1 , RED);
	playerx[cnt] = x+6;
	playery[cnt] = y-1;
	cnt++;
	write_pixel(x+7 , y-1 , RED);
	playerx[cnt] = x+7;
	playery[cnt] = y-1;
	cnt++;
	write_pixel(x+6 , y , RED);
	playerx[cnt] = x+6;
	playery[cnt] = y;
	cnt++;
	write_pixel(x+7 , y , RED);
	playerx[cnt] = x+7;
	playery[cnt] = y;
	cnt++;
}

void drawsq(int x , int y , short colour){
	for(int i = -7 ; i<7 ; i++){
		for(int j = -7 ; j<7 ; j++){
			if(x+i>319 || x+i<0) continue;
			write_pixel(x+i , y+j , co);
			chkbox[x+i][y+j] = 1;
			// color[x+i][y+i] = co;
		}
	}
}
void erase_sq(int x , int y ){
	for(int i = -7 ; i<7 ; i++){
		for(int j = -7 ; j<7 ; j++){
			if(i>319 || i<0) continue;
			write_pixel(x+i , y+j , 0);
			chkbox[x+i][y+j] = 0;
			// color[x+i][y+i] = 0;
		}
	}
}
