void fireball(int x, int y){
	int cnt = 0;
	for(int i = -3 ;i<=3 ; i++){
		for(int j = -3 ; j<=3 ; j++){
			write_pixel(x+i , y+j , 0xffff);
			color[x+i][y+j] = 0xffff;
			cnt++;
		}
	}
}
void fireball_erase(int x , int y){
	int cnt = 0;
	for(int i = -3 ;i<=3 ; i++){
		for(int j = -3 ; j<=3 ; j++){
			write_pixel(x+i , y+j , 0);
			color[x+i][y+j] = 0;
			cnt++;
		}
	}

}
int firball_meter(int x){
	char st[14] = {'F' , 'I' , 'R' , 'E' , 'B' , 'A' , 'L' , 'L' , '_' , 'M' , 'E' , 'T' , 'E'  ,'R'};
	for(int i = 0 ; i<14 ; i++){
		write_char(0 + i , 2 , st[i]);
	}
	for(int i = 0 ; i<22 ; i++){
		write_pixel(10+i , 13 , 0xffff);
		write_pixel(10+i , 19 , 0xffff);
	}
	for(int i = 0 ; i<6 ; i++){
		write_pixel(10  , 13 + i , 0xffff);
		write_pixel(32  , 13 + i , 0xffff);
	}
	for(int i = 11 ; i<=31 ; i++){
		for(int j = 14 ; j<=18 ; j++){
			write_pixel(i , j , color[i][j]);
		}
	}
	int mini = x;
	if(x>20){
		mini = 20;
	}
	for(int i = 0 ; i<=mini; i++){
		for(int j = 0 ; j<5 ; j++){
			write_pixel(11+i , 14+j , RED);
		}
	}
	if(x>20){
		return 1;
	}
	else return 0;
}

