void motion(){
	clear_screen();
	for(int i = 0 ; i<240 ; i++){
		for(int j = 0 ; j<320 ; j++){
			color[j][i] = 0;
			chkbox[j][i] = 0;
		}
	}
	backgr(1);
	int collision = 0;
	co = GREEN;
	player_design(50 , 120);
	
	int xx = 50;
	int vx = 10;
	int yy = 120;
	int vy = 10;
	int fx = xx;
	int fy = yy;
	int fireball_active = 0;
	volatile int *JTAG_UART_ptr = (int *)0xFF201000;
	int time = 0;
	int cntr = 0;
	int time2 = 0;
	int cntr2 = 0;
	
	create_boxes( co );
	while(1){
		if(time > 1500){
			boss_screen();
			return;
		}
		cntr++;
		cntr2++;
		cntr2%=300;
		cntr %= 3000;
		if(cntr2==1 && fireball_active == 1){
			if(fx>310){
				fireball_active = 0;
				fireball_erase(fx , fy);
				continue;
			}
			fireball_erase(fx , fy);
			time2++;
			fx+=1;
			fireball(fx , fy);

		}
		if(cntr == 1){
			for(int i = time ; i<time+320 ; i++){
				if(a1[i] == 1){
					erase_sq(i-time , 80);
				}
				if(a2[i] == 1){
					erase_sq(i-time , 120);
				}
				if(a3[i] == 1){
					erase_sq(i-time , 160);
				}
			}
			time++;


			for(int i = time ; i<time+320 ; i++){
				if(a1[i] == 1){
					drawsq(i-time , 80 , co);
				}
				if(a2[i] == 1){
					drawsq(i-time , 120 , co);
				}
				if(a3[i] == 1){
					drawsq(i-time , 160 , co);
				}
			}
			for(int i = 0 ; i<400 ; i++){
				if(chkbox[playerx[i]][playery[i]] == 1){
					collision = 1;
				}
			}

			
		}
		if(collision){
			game_over();
			return;
		}
		
		char c = get_jtag(JTAG_UART_ptr);
		int f = 0;
		if(c=='W'||c=='w' ){
			if(yy-vy > 73){
				yy-=vy;
				f = 1;
			}
		}
		if(c=='a'|| c=='A'){
			xx-=vx;
			if(xx<0) xx+=vx;
			f = 1;
		}
		if(c=='s'||c=='S'){
			if(yy+vy < 169){
				yy+=vy;
				f = 1;
			}
		}
		if(c=='d'||c=='D'){
			xx+=vx;
			if(xx>319)xx-=vx;
			f = 1;
		}
		if(f){
			for(int i = 0 ; i<400 ; i++){
				write_pixel(playerx[i] , playery[i] , color[playerx[i]][playery[i]]);
			}
			player_design(xx , yy);
		}
		if((c== 'q' || c=='Q')&& (fireball_active==0)){
			fx = xx;
			fy = yy;
			fireball_active = 1;
		}
		
	}

}
int draw_rect(int x , int y , int a , int b , short co){
	for(int i = 0 ; i<a ; i++){
		for(int j = 0 ; j<b ; j++){
			write_pixel(x+i , y+j , co);
		}
	}
}



